import React, { useState } from 'react';
import axios from 'axios';

const DashboardMother = () => {
  const [report, setReport] = useState({
    anonymous: false,
    program: '',
    abuserName: '',
    childName: '',
    incidentDescription: '',
    incidentType: '',
    urgency: '',
    attachments: []
  });
  const [submitting, setSubmitting] = useState(false);

  const handleChange = (e) => {
    setReport({ ...report, [e.target.name]: e.target.value });
  };

  const handleFileChange = (e) => {
    setReport({ ...report, attachments: e.target.files });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setSubmitting(true);
    const formData = new FormData();
    Object.keys(report).forEach(key => {
      if (key === 'attachments') {
        for (let file of report.attachments) {
          formData.append('attachments', file);
        }
      } else {
        formData.append(key, report[key]);
      }
    });

    try {
      await axios.post('/api/reports/create', formData);
      alert('Report submitted successfully. AI analysis is being generated.');
      setReport({
        anonymous: false,
        program: '',
        abuserName: '',
        childName: '',
        incidentDescription: '',
        incidentType: '',
        urgency: '',
        attachments: []
      });
    } catch (error) {
      alert('Submission failed. Please try again.');
    } finally {
      setSubmitting(false);
    }
  };

  return (
    <div style={{ maxWidth: '800px', margin: '2rem auto', padding: '1rem' }}>
      <div className="card">
        <h2 style={{ color: 'var(--primary)', marginBottom: '1.5rem' }}>Create Signalement (Mother/Aunt/Educator)</h2>
        <form onSubmit={handleSubmit}>
          <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '1rem' }}>
            <div>
              <label style={{ display: 'flex', alignItems: 'center', gap: '0.5rem', marginBottom: '1rem', cursor: 'pointer' }}>
                <input
                  type="checkbox"
                  name="anonymous"
                  checked={report.anonymous}
                  onChange={(e) => setReport({ ...report, anonymous: e.target.checked })}
                  style={{ width: 'auto', margin: 0 }}
                />
                Anonymous Reporting
              </label>

              <input type="text" name="program" placeholder="Village / Program Name" value={report.program} onChange={handleChange} required />
              <input type="text" name="abuserName" placeholder="Abuser Full Name" value={report.abuserName} onChange={handleChange} required />
              <input type="text" name="childName" placeholder="Child Full Name" value={report.childName} onChange={handleChange} required />
            </div>

            <div>
              <select name="incidentType" value={report.incidentType} onChange={handleChange} required>
                <option value="">Select Incident Type</option>
                <option value="health">Health Issues</option>
                <option value="behavior">Behavioral Concern</option>
                <option value="violence">Violence/Abuse</option>
                <option value="other">Other</option>
              </select>

              <select name="urgency" value={report.urgency} onChange={handleChange} required>
                <option value="">Select Urgency Level</option>
                <option value="low">Low - Monitor</option>
                <option value="medium">Medium - Action Needed</option>
                <option value="high">High - Urgent</option>
                <option value="critical">Critical - Emergency</option>
              </select>

              <label style={{ fontSize: '0.9rem', opacity: 0.7, display: 'block', marginBottom: '0.5rem' }}>Attachments (Photo, Audio, Video)</label>
              <input type="file" multiple onChange={handleFileChange} style={{ border: '1px dashed #cbd5e1', padding: '1rem', background: 'white' }} />
            </div>
          </div>

          <textarea
            name="incidentDescription"
            placeholder="Describe the incident in detail (Champ libre)..."
            value={report.incidentDescription}
            onChange={handleChange}
            style={{
              width: '100%',
              height: '120px',
              padding: '0.75rem',
              borderRadius: '0.5rem',
              border: '1px solid #e2e8f0',
              marginBottom: '1.5rem'
            }}
            required
          />

          <button
            type="submit"
            style={{ width: '100%', background: 'var(--primary)', color: 'white', fontSize: '1.1rem' }}
            disabled={submitting}
          >
            {submitting ? 'Analyzing Media & Sending...' : 'Submit Signalement'}
          </button>
        </form>
      </div>
    </div>
  );
};

export default DashboardMother;
